CREATE TABLE users(
    id serial primary key,
    login text not null,
    name text not null,
    surname text not null,
    email text not null,
    hashed_password text not null,
    age integer not null
);

--Данные сгенерированы на сайте mockaroo.com

CREATE INDEX login_idx on users(login);
CREATE INDEX full_name_idx on users(name, surname); 

